var ActionType =
    {
        CREATED  : 0,
        ACTION : 1,
        DELETED  : 2,
    };

function Logger() {
    this.messages = [];
}

function Message(_type, _message, _function) {
    this.message_type = _type;
    this.message = _message;
    this.function = _function;
}

Message.prototype.get_text = function () {
    let shift = "        ";
    return this.function + "()" + shift + this.message_type + shift + this.message;
};

head_font_size = 20;
normal_text_size = 13;
loggs_text_size = 10;

position = 10;
footer_top = 15;
pageHeight = 0;

function create_report() {
    console.log("report created!");

    var doc = new jsPDF();
    pageHeight = doc.internal.pageSize.height;


    var width = doc.internal.pageSize.width;
    var height = doc.internal.pageSize.height / 3;


    add_headers(doc);
    add_map(doc, width, height);
    add_logs(doc);
    doc.save('a4.pdf');
}

function add_headers(doc) {
    doc.setFontSize(head_font_size);
    doc.setFontType('bold');

    doc.text(20, position, 'Report');
    position += footer_top;

    doc.setFontSize(normal_text_size);

    doc.setFontType('bold');
    doc.text(20,position, 'Created by : ');


    doc.setFontType('normal');
    doc.text(70,position, 'Artem Malynovskyi');
    position += (footer_top/2);

    doc.text(70,position, 'Katerina Dubok');
    position += (footer_top/2);

    doc.text(70,position, 'Olexii Checkanin');
    position += (footer_top);

    doc.setFontType('bold');
    doc.text(20,position, 'Date created :' );

    doc.setFontType('normal');
    doc.text(70,position, new Date().toString());
    position += (footer_top);

}

function add_map(doc, width, height) {

    doc.setFontSize(head_font_size);
    doc.setFontType('bold');

    doc.text(20,position, '1. Map object');
    position += footer_top;

    var map_image = 'data:image/png;base64,';
    doc.addImage(map_image, 'PNG', 0, position, width, height);
    position +=(height+footer_top);

}

function add_logs(doc) {

    doc.setFontSize(head_font_size);
    doc.setFontType('bold');

    doc.text(20,position, '2. Loggs');
    position += footer_top;

    doc.setFontSize(normal_text_size);
    doc.setFontType('bold');
    doc.setTextColor(0, 0, 0);
    doc.text(20,position, 'Object created :');
    doc.setTextColor(0, 255, 0);
    doc.text(70,position, 'Highlighting color');
    position += (footer_top/2);

    doc.setFontSize(normal_text_size);
    doc.setFontType('bold');
    doc.setTextColor(0, 0, 0);
    doc.text(20,position, 'Object deleted :');
    doc.setTextColor(255, 0, 0);
    doc.text(70,position, 'Highlighting color');
    position += (footer_top/2);


    doc.setFontSize(normal_text_size);
    doc.setFontType('bold');
    doc.setTextColor(0, 0, 0);
    doc.text(20,position, 'Object action :');
    doc.setTextColor(0, 0, 255);
    doc.text(70,position, 'Highlighting color');


    position += footer_top;


    doc.setFontSize(loggs_text_size);
    doc.setFontType('normal');

    logger.messages.push(new Message(ActionType.ACTION,'Nice draw','draw()'));
    logger.messages.push(new Message(ActionType.DELETED,'Nice draw','draw()'));
    logger.messages.push(new Message(ActionType.ACTION,'Nice draw','draw()'));
    logger.messages.push(new Message(ActionType.ACTION,'Nice draw','draw()'));


    doc.setTextColor(0, 0, 0);
    doc.setFontType('bold');
    doc.setFontSize(normal_text_size);


    doc.text(20,position,"Function");
    doc.text(50,position,"Action type");
    doc.text(80,position,"Message");


    position += footer_top/2;

    for (let i = 0; i < logger.messages.length; i++) {
        add_log(doc,i);
    }
}

function add_log(doc,i){
    let message = logger.messages[i];



    doc.setFontType('normal');
    doc.setFontSize(loggs_text_size);

    doc.text(20,position,(i+1)+".    "+ message.function);

    let action_type = '123';

    console.log(message.type);

    switch(message.message_type){
        case ActionType.CREATED:
            doc.setTextColor(0, 255, 0);
            action_type = 'CREATED';
            break;
        case ActionType.ACTION:
            doc.setTextColor(0, 0, 255);
            action_type = 'ACTING';
            break;
        case ActionType.DELETED:
            doc.setTextColor(255, 0, 0);
            action_type = 'DELETED';
            break;
    }
    doc.text(50,position, action_type);

    doc.setTextColor(0, 0, 0);
    doc.text(80,position, message.message);



    position += footer_top/3;
    if((position +20) > pageHeight){
        doc.addPage();
        position = 10;
    }

}